import React, {useState,Component } from "react";
import '../App.css'
import { Card, Container,Nav,Button,Form } from "react-bootstrap";
import Header from '../components/Header';
import axios from 'axios';
import {useHistory} from 'react-router-dom';

export default function DoctorLogin(props) {
 
  const history= useHistory();
  // const handleChange=()=>{
  //     props.history.push('/DoctorDashboard')
  // }
   const [doctor_id, setDoctor_id] = useState("");
   const [password, setPassword] = useState("");

   const [loginStatus, setLoginStatus] = useState("");


const login = ()=>{
  axios.post("http://localhost:3001/doctorRegistration/login",{
    doctor_id : doctor_id,
    password : password,
  }).then((response)=>{
   if(response.data.message){
     setLoginStatus(response.data.message);
   }else{
     setLoginStatus(response.data[0].doctor_id);
   }
   props.history.push('/DoctorDashboard')
  });
};

    return(
        <div>
             <Header />
        <Container fuild="xl">
            <Card className="myCard">
  <Card.Header>
    <Nav variant="tabs">
      <Nav.Item>
        <Nav.Link href="/AdminLogin" >Admin</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VCLogin">Vaccination Center</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerificationLogin" >
          Verification Center
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/VerifierLogin">
          Verifier
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link href="/DoctorLogin" active >
          Doctor
        </Nav.Link>
      </Nav.Item>
    </Nav>
  </Card.Header>
  <Card.Body>
    <Card.Title className="cardTitle">Doctor Login</Card.Title>
    <Card.Text>
    <Form >
  <Form.Group controlId="formBasicIDl">
    <Form.Label className="formLabel">Doctor-id</Form.Label>
    <Form.Control type="text" onChange={(e)=>{setDoctor_id(e.target.value)}}  name="doctor_id" placeholder="Enter ID" />
    
  </Form.Group>

  <Form.Group controlId="formBasicPassword">
    <Form.Label className="formLabel">Password</Form.Label>
    <Form.Control type="password" onChange={(e)=>{setPassword(e.target.value)}}  name="password"   placeholder="Password" />
  </Form.Group>
  
</Form>
    </Card.Text>
    <Button onClick={login} className="loginBtn" variant="primary">Login</Button>
  </Card.Body>
</Card>
        </Container>
        </div>
    )
}
